# detect running on AMD64 CPUs, even when booted in i386 mode. OPMODES=`lscpu | sed -n "/CPU op/s/CPU op.*: *//p"` if [ ! -z "$OPMODES" ]; then if [ "$OPMODES" = "32-bit, 64-bit" ]; then echo -n "HWAMD64 "; else echo -n "HW686 " fi fi
